import React from "react";
import { Switch } from "react-router-dom";
import "./styling/App.css";

function App() {
	return (
		<div className="App">
			<h1>WELCOME</h1>
			<Switch>
				<Route path="/commissions" component={Commissions} />
				<Route exact path="/" component={Home} />
			</Switch>
		</div>
	);
}

export default App;
